import React from 'react';

import NavBar from '../UI/NavBar';
import Footer from '../UI/Footer';
import classes from './Shop.module.css';

const Shop = () => {
  return (
    <div>
      <NavBar />
      <header className={classes.header}>SHOP</header>
      <Footer />
    </div>
  );
};

export default Shop;
